// Navigation.js

import React from "react";
import { Link } from "react-router-dom";

export const Navigation = () => {
  const navContainerStyle = {
    backgroundColor: "#2196f3", // Blue background color
    color: "#fff",
    padding: "15px",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
  };

  const logoStyle = {
    margin: "0",
    fontSize: "14px",
  };

  const navlinksStyle = {
    display: "flex",
  };

  const navButtonStyle = {
    margin: "0",
    padding: "10px",
    color: "#fff",
    backgroundColor: "#1565c0", // Blue button color
    borderRadius: "15px",
    border: "none",
    textDecoration: "none",
    cursor: "pointer",
  };

  const navButtonHoverStyle = {
    backgroundColor: "#FF0000", // Darker blue on hover
    borderRadius: "15px",
  };

  return (
    <div style={navContainerStyle}>
      <div style={logoStyle}>
        <h1>PHARMACIST</h1>
      </div>
      <div style={navlinksStyle}>
        <Link to="/logout">
          <button style={navButtonStyle}>Home</button>
        </Link>
        <Link to="/">
          <button style={{ ...navButtonStyle, ...navButtonHoverStyle }}>
            Logout
          </button>
        </Link>
      </div>
    </div>
  );
};
